const PRODUCTS = [
    {id: "p1", title: "product-1"},
    {id: "p2", title: "product-2"},
    {id: "p2", title: "product-3"},
]
const ProductsPage = ()=>{

    return <>
    <h1>The products page</h1>
    <ul>
        {PRODUCTS.map(prod => <Link to={`/products/${prod.id}`}><li key={prod.id}>{prod.title}</li></Link>)}
    </ul>

    </>
}

export default ProductsPage;
